"   </div>",
"   <div class=\"cntnt\" style=\"width: 415px; height: 259px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The popliteal angle is a measure of hamstring flexibility. With the patient relaxed and supine, flex the knee to 90 degrees, then gently extend the lower leg until you appreciate resistance. The angle of the leg at this point is the popliteal angle and is an objective measure of hamstring flexibility.",
