var title_f4_36_4676="Internuclear ophthalmoplegia";
var content_f4_36_4676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F53437&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F53437&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 473px\">",
"   <div class=\"ttl\">",
"    Internuclear ophthalmoplegia (INO)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 453px; height: 469px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This patient exhibits a left INO characterized by adduction slowing without ocular limitation. The top picture (A) depicts the patient in a primary gaze position, while the bottom picture (B) depicts the point at which the right eye reaches a 20 degree target while saccading to the right. Note that the right eye reaches the target prior to the left eye, as demonstrated with the midpupillary markers shown. (Note that the left eye has not changed position off of the midpupillary marker). At saccade end, both eyes achieve target fixation (as shown in the oculogram).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Frohman EM, O'Suilleabhain P, Dewey RB, et al. A new measure of dysconjugacy in INO: the first-pass amplitude. J Neurol Sci 2003; 210:65. Copyright &copy;2003 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
