var title_f4_36_4678="AJCC diagram of the esophageal anatomy";
var content_f4_36_4678=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F76958&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F76958&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    AJCC regions of the esophagus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 440px; height: 659px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The American Joint Committee on Cancer (AJCC) divides the esophagus into four areas. The cervical esophagus extends from the lower border of the cricoid cartilage to the thoracic inlet. The upper thoracic esophagus extends from the thoracic inlet to the tracheal bifurcation. The mid-thoracic esophagus extends from the tracheal bifurcation to a level approximately 32 cm from the incisors. The lower thoracic and abdominal esophagus extends from the mid-thoracic esophagus to the EG junction, approximately 40 cm from the incisors.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     <em>",
"      Data from: Esophagus. In: AJCC Cancer Staging Manual, 6th edition, 2002.",
"     </em>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
