var title_f4_36_4684="Multistep approach treatment infertility PCOS";
var content_f4_36_4684=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F56718&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F56718&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Multistep approach to treatment of anovulatory infertility associated with polycystic ovary syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Step",
"       </td>",
"       <td class=\"subtitle1\">",
"        Intervention",
"       </td>",
"       <td class=\"subtitle1\">",
"        Cost",
"       </td>",
"       <td class=\"subtitle1\">",
"        Risk of multiple gestation pregnancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        Weight loss (if baseline weight is elevated)",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"       <td>",
"        Not increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        Clomiphene",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"       <td>",
"        Modest increase in risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Clomiphene plus adjuvants*",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"       <td>",
"        Modest increase in risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        FSH injections",
"       </td>",
"       <td>",
"        Resource intensive",
"       </td>",
"       <td>",
"        Markedly increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5",
"       </td>",
"       <td>",
"        Ovarian surgery",
"       </td>",
"       <td>",
"        Resource intensive",
"       </td>",
"       <td>",
"        Not increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6",
"       </td>",
"       <td>",
"        In vitro fertilization",
"       </td>",
"       <td>",
"        Resource intensive",
"       </td>",
"       <td>",
"        Potentially increased but controllable (eg, single embryo transfer)&bull;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The initial steps emphasize interventions that are low cost and associated with a low risk of multiple gestation.",
"    <div class=\"footnotes\">",
"     *Most clinicians go directly to FSH injections if clomiphene alone fails. However, the addition of dexamethasone, pretreatment with oral contraceptives, or metformin&nbsp;is an alternative for those who value low cost and low risk of multiple gestation.",
"     <br>",
"      &bull; This increased risk is dependent on the number of embryos transferred.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert L Barbieri, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
